import  ReactDOM, { render }  from 'react-dom';

function App(){
  return(
    <div>
      <h1>Hi There!</h1>
      <p>My name is Taaif, and I am  a seineor computer sience student at TU.</p>
        <ul>
          <li>Twitter</li>
          <li>LinkedIn</li>
          <li>Facebook</li>
        </ul>
  </div>
  );
}

ReactDOM.render( <App />
  , document.getElementById('root'));
